import Background from '../../assets/Overviewpage-Group-83.jpg'

const Ow_Hero = () => {
    return (
        <section className="w-full flex flex-col justify-between h-screen bg-fullcenter flex-centralizer items-center" style={{ backgroundImage: "url(" + Background + ")" }}>
            <h1>Find Your Best, Then Customize It for Yourself</h1>
        </section>
    )
};

export default Ow_Hero;
